import React, { Component } from 'react';
import { DetailWrapper, Title, Content } from './style.js';

class Detail extends Component {
	render() {
		return (
			<DetailWrapper>
				<Title>title</Title>
				<Content>
					<img src="https://img.sndimg.com:443/food/image/upload/w_560,h_315,c_fill,fl_progressive,q_80/v1/img/recipes/28/76/36/picgv6xa8.jpg" alt="" />
					<p>Preheat oven to 425 degrees Fahrenheit. Pierce potatoes a few times with a fork. Place oil in a small bowl. Place salt in another small bowl (if using). Place one potato at a time into oil bowl, and roll potato around in oil.</p>
				</Content>
			</DetailWrapper>
		)
	}
}

export default Detail;
